import { NavLink } from "react-router-dom";
import './NavBar.css'
const NavBar = () =>{
    return(
        <div>
        <NavLink activeClassName="active" style={{ margin: "20px" }} to="/search">HOME</NavLink>
        <NavLink activeClassName="active" style={{ margin: "20px" }} to="/specification">SEARCH</NavLink>
        <NavLink activeClassName="active" style={{ margin: "20px" }} to="/addDotor">ADD</NavLink>
        <NavLink activeClassName="active" style={{ margin: "20px" }} to="/EditDoctor">EDIT</NavLink>

                 </div>

)
}

export default NavBar;
